    <div className="wrapper">
        <div className='accordion'>
           {data.map((item, i) => {
            return (
                <div className="item">
                    <div className="title">
                      <h2>{item.question}</h2>  
                      <h2></h2>  
                    </div>
                    <div className="content">
                        {item.answer}
                    </div>
                </div>
            )
           })}
        </div>
    </div>
  )
}
const data = [
    {question:"que es unicef heroes run", answer:"Es una serie de corridas familiares organizadas por UNICEF para promover los derechos de la infancia presentadas por los conocidos superhéroes de DC Comics, Wonder Woman, Batman, Superman y la Liga de la Justicia."}
